import React, { useEffect, useState } from 'react'
import Players from '../Arrays/Players'
import Player from '../Single/Player'
import './Roster.css'

const Roster = () => {

  const [ playmakers, setPlaymakers ] = useState([])
  const [ guards, setGuards ] = useState([])
  const [ centers, setCenters ] = useState([])
  const [ wingers, setWingers ] = useState([])
  const [ coach, setCoach ] = useState([])

  useEffect(() => {

    let play = Players.filter((p) => p.position === "Playmaker");
    setPlaymakers(play);

    let guard = Players.filter((p) => p.position === "Guardia");
    setGuards(guard);

    let cent = Players.filter((p) => p.position === "Centro");
    setCenters(cent);

    let wing = Players.filter((p) => p.position === "Ala");
    setWingers(wing);

    let c = Players.filter((p) => p.position === "Coach");
    setCoach(c);
  }, [])

  return (
    <div className='roster'>
        <div className='roster-container'>
          <div className='roster-playmakers'>
            <h1>Playmakers</h1>
            {playmakers.map(player => (
                <Player 
                    name = {player.name} 
                    surname = {player.surname}
                    number = {player.number}
                    position = {player.position}
                    photo = {player.photo}
                />
            ))}
          </div>
          <div className='roster-guards'>
            <h1>Guards</h1>
            {guards.map(player => (
                <Player 
                    name = {player.name} 
                    surname = {player.surname}
                    number = {player.number}
                    position = {player.position}
                    photo = {player.photo}
                />
            ))}
          </div>
          <div className='roster-centers'>
            <h1>Centers</h1>
            {centers.map(player => (
                <Player 
                    name = {player.name} 
                    surname = {player.surname}
                    number = {player.number}
                    position = {player.position}
                    photo = {player.photo}
                />
            ))}
          </div>
          <div className='roster-wingers'>
            <h1>Wingers</h1>
            {wingers.map(player => (
                <Player 
                    name = {player.name} 
                    surname = {player.surname}
                    number = {player.number}
                    position = {player.position}
                    photo = {player.photo}
                />
            ))}
          </div>
        </div>
    </div>
  )
}

export default Roster
